export default function Tiles() {
  const [isButtonClicked, setIsButtonClicked] = useState(false);

  function openTopicHandler() {
    setIsButtonClicked(true);
    console.log("Open Topic Handler Working");
  }
  return (
    <div>
      <button onClick={openTopicHandler}>+</button>
      {isButtonClicked ? <div></div> : <div></div>}
    </div>
  );
}
